export function add37(a: number, b: number): number {
  return a + b;
}

export function subtract37(a: number, b: number): number {
  return a - b;
}

export function multiply37(a: number, b: number): number {
  return a * b;
}

export function divide37(a: number, b: number): number {
  return a / b;
}
